t.add("welcome.add_loyalty_cards.desc_v2", "AwardWallet is not solely about travel; while we hope you use AwardWallet to track your frequent flyer miles and hotel points, we\u2019re fanatics about all types of rewards. We cover retail loyalty programs like Starbucks and Best Buy along with rewards programs associated with all the major banks; in all, we support almost 700 programs. Browse the %link1_on%list of our supported programs%link1_off%. %status%Concerned about security? So are we. We don\u2019t fool around when it comes to our members and their rewards. Here is our statement about security: %link2%. We recommend you also consider setting up %link3_on%two-factor authentication%link3_off% for added protection.", "email", "en");
t.add("welcome.blog", "We\u2019ve created a blog to %link1_on%deliver points and miles content to you on a daily basis%link1_off%. We cover everything from relevant news to how to get the best value from your points and miles.", "email", "en");
t.add("welcome.book_reward_tickets.desc_v2", "Ready to take a trip but having difficulties redeeming your hard-earned miles? We have a team that is ready to help! Tell us where you want to go by submitting a booking request: %link% and we will find the best use of your points miles, and book your tickets for you.", "email", "en");
t.add("welcome.book_reward_tickets_v2", "Redeem Points & Miles", "email", "en");
t.add("welcome.choose_cc.desc_v2", "If you are serious about earning miles & points, you need to know the %link1_on%best reward credit cards%link1_off% available on the market today. Rewards cards are a big key to quickly racking up miles. Our #1 pick %link2_on%is a flexible travel rewards credit card%link2_off% , which allows you to redeem your rewards like cash or transfer to air\/hotel travel partners.", "email", "en");
t.add("welcome.choose_cc_v2", "Choose the Right Rewards Credit Card", "email", "en");
t.add("welcome.facebook", "We also have a Facebook community, %link1_on%Award Travel 101%link1_off%, with tens of thousands of members. If you\u2019ve got a rewards question that you want answered, this is your go-to place!", "email", "en");
