t.add("welcome.get_app.desc_v2", "We have an awesome app for %link1_on%iOS%link1_off% and %link2_on%Android%link2_off% devices. If you have an AwardWallet account already, installing our mobile app keeps you closer to your points and miles.", "email", "en");
t.add("welcome.organize_trips.desc_v2", "Want a single place to keep all of your travel plans? We\u2019ve got you covered. AwardWallet can take each travel component for all of your trips from different providers, including air, hotel, rental cars, and dining, organize them, put all of them into one - easy to use timeline. You can import your trips by pulling them from your loyalty accounts: %link% or you can email them to your custom AwardWallet mailbox: %email%.", "email", "en");
