t.add("answer.1", "AwardWallet.com has 3 core features:\n<ol class=\"counter-list\">\n\t<li>AwardWallet is designed to help tracking different loyalty accounts for you and your family. We do it by logging into the different reward accounts and retrieving your balance on your behalf. We will retrieve or calculate expiration, elite level, etc. and show this information in a single, easy to understand report.<\/li>\n\t<li>AwardWallet will help you manage your travel plans via our &quot;<a href=\"\/trips\/\">Trips<\/a>&quot; feature on the web and via our mobile apps.<\/li>\n\t<li>AwardWallet helps you redeeming your miles for first or business class international fares. Just <a href=\"\/awardBooking\/add\">submit a booking request<\/a> and our team will work on finding the best itinerary for you.<\/li>\n<\/ol>", "faq", "en");
t.add("answer.10", "<div class=\"secure-information\">\n<div class=\"row\">\n<div class=\"thumb\"><i class=\"faq-icon-1\">&nbsp;<\/i><\/div>\n\n<div class=\"description\">\n<p>We always use <span class=\"red\">industry-standard encryption technologies<\/span> when transferring and receiving customer&#39;s data exchanged with our site. We have appropriate security measures in place in our physical facilities to protect against the loss, misuse or alteration of information that we have collected from you.<\/p>\n<\/div>\n<\/div>\n\n<div class=\"row\">\n<div class=\"thumb\"><i class=\"faq-icon-2\">&nbsp;<\/i><\/div>\n\n<div class=\"description\">\n<p>We offer and encourage our users to <a href=\"https:\/\/awardwallet.com\/user\/edit.php\">enable<\/a> <span class=\"red\">two-factor authentication<\/span> on their accounts. This way even if someone steals your AwardWallet password or gets a hold of your computer they would still need a way to generate a one-time code to get into your profile.<\/p>\n<\/div>\n<\/div>\n\n<div class=\"row\">\n<div class=\"thumb\"><i class=\"faq-icon-3\">&nbsp;<\/i><\/div>\n\n<div class=\"description\">\n<p>All of your <span class=\"red\">sensitive data is encrypted<\/span> in our secure database. Whenever we transfer your passwords we use https secure protocol (heartbleed free). We also give you the ability to store your passwords locally on your computer in a cookie. However, there are advantages of storing your passwords in our database, for example we would be able to automatically check your balances for you and then send you a report with your balance changes. Thousands of people have trusted us with their account information, our service is very mature (we launched our website in 2004) and the website is hosted and founded in the United States of America.<\/p>\n<\/div>\n<\/div>\n\n<div class=\"row\">\n<div class=\"thumb\"><i class=\"faq-icon-4\">&nbsp;<\/i><\/div>\n\n<div class=\"description\">\n<p>We <span class=\"red\">participate in a bounty bug hunt<\/span> with&nbsp;Cobalt&nbsp;<a href=\"https:\/\/cobalt.io\/awardwallet\">https:\/\/cobalt.io\/awardwallet<\/a> where we pay hackers to find security issues with our service.<\/p>\n<\/div>\n<\/div>\n<\/div>\n&nbsp;\n\n<p><strong>Finally for the techies out there here is more info:<\/strong><\/p>\n\n<ul>\n\t<li>Your AwardWallet passwords are hashed with bcrypt, cost:13, plus unique salt for each user.<\/li>\n\t<li>For the passwords that users store locally on their computers we use Rijndael (similar to AES), 256 bit.<\/li>\n\t<li>The &quot;remember me&quot; cookie is a sha 256 hash&nbsp;of certain user attributes<\/li>\n\t<li>Loyalty account passwords are encrypted with 1024 RSA key.<\/li>\n\t<li>If someone is trying to brute-force your account we will lock them out for a period of time after few invalid login attempts.<\/li>\n<\/ul>", "faq", "en");
t.add("answer.11", "After you login you need to go to &quot;<a class=\"a14pxBlue\" href=\"\/account\/list.php\">My Award Programs<\/a>&quot;. On this page you can navigate to &quot;<a class=\"a14pxBlue\" href=\"\/account\/add.php\">Add a New Program<\/a>&quot; on the left navigation menu. Choose an award program from the list to be added to your profile. Please note that before adding a program you need to know your user name and password from the loyalty program&#39;s website that provides your balance. If you can&rsquo;t login to the website that provides the balance (i.e for Marriott it would be <a class=\"a14pxBlue\" href=\"http:\/\/www.marriott.com\">http:\/\/www.marriott.com<\/a>) AwardWallet would not be able to retrieve the balance either. After you add an award program to your profile it will show up under the &quot;<a class=\"a14pxBlue\" href=\"\/account\/list.php\">BALANCES<\/a>&quot; section. There you can either click the &quot;update&quot; button to automatically retrieve the balance for just one program, or you can click &quot;Update All&quot; button to automatically update all award programs on your profile. Please note that if your login info is correct you can also use our auto-login feature, so that AwardWallet.com would automatically log you into the provider&#39;s website (i.e. www.marriott.com). This way you can see any additional information about your account. The auto-login feature is available on most of the award programs that we support. For more details about the auto-login please see this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/<\/a>", "faq", "en");
t.add("answer.14", "No. AwardWallet can not transfer miles between programs, even if the award program allows transferring miles \/ points only the owner of the account can request such a transfer directly with the award program provider.", "faq", "en");
t.add("answer.19", "After you added an award program to your profile you can follow the &quot;edit&quot; link, where you will be able to add a short comment to any given account (i.e. Mom&rsquo;s account).", "faq", "en");
t.add("answer.2", "No. AwardWallet is not affiliated with any airlines, hotels or any other award programs and therefore does not have access to&nbsp;that information. It is your responsibility to know your award program numbers, ids, passwords etc.", "faq", "en");
