t.add("answer.21", "<table border=\"0\" cellpadding=\"10\" cellspacing=\"0\" class=\"main-table upgraded-account\">\n\t<thead>\n\t\t<tr>\n\t\t\t<th>&nbsp;<\/th>\n\t\t\t<th align=\"center\">AwardWallet Free<\/th>\n\t\t\t<th align=\"center\">AwardWallet Plus<\/th>\n\t\t<\/tr>\n\t<\/thead>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td>Automatically track reward balances<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Track rewards for your family members<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Automatically track travel plans<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Allow sharing travel plans or reward balances<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Notify when balances expire via email and (optionally) push notifications on your phone<br \/>\n\t\t\t(frequency: 90, 60, 30, and 7 days before expiration)<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Access all of your data on a mobile device<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td><a class=\"blue-link\" href=\"https:\/\/awardwallet.com\/faqs.php#44\">Set up two-factor authentication<\/a> on your account<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Display extra reward account properties<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Display historical account balance changes chart<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Display historical transactions for some of your loyalty accounts<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Credit card spend analytics of day-to-day transactions to optimize points earned with each merchant<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Allow exporting award balances into Excel or PDF formats<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Update accounts in parallel (up to 5X faster)<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Number of times users can update a single account per 24 hours<\/td>\n\t\t\t<td align=\"center\">Twice<\/td>\n\t\t\t<td align=\"center\">Unlimited<\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Display expiration date of your miles or points<\/td>\n\t\t\t<td align=\"center\">Up to 3 expirations<\/td>\n\t\t\t<td align=\"center\">Unlimited<\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Support AwardWallet development efforts<\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td>\n\t\t\t<td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td>\n\t\t<\/tr>\n\t\t<tr>\n\t\t\t<td>Price<\/td>\n\t\t\t<td align=\"center\">FREE<\/td>\n\t\t\t<td align=\"center\">$30 for 1 year<\/td>\n\t\t<\/tr>\n\t<\/tbody>\n<\/table>", "faq", "en");
t.add("answer.24", "Yes. None of your data will be deleted you will just be downgraded with an option to upgrade.", "faq", "en");
t.add("answer.27", "<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/27-1.png\" style=\"width: 650px; height: 59px;\" \/>\n<p style=\"line-height:1.5\">1. Indicates that the balance has changed in the last 24 hours<br \/>\n2. Checkbox to select this account for further actions<br \/>\n3. Shows more details about the account<br \/>\n4. Auto-login is disabled for this account<br \/>\n5.&nbsp;Provider alliance icon<br \/>\n6. Alliance elite level progress<br \/>\n7. Username used to login to this account<br \/>\n8. Account number<br \/>\n9. Indicates that the password for this account is stored locally in the browser<br \/>\n10. Current elite level in the program<br \/>\n11. Elite level progress<br \/>\n12. Account balance<br \/>\n13. Indicates that background updating is turned off for technical reasons<br \/>\n14. Shows it is the custom entry and the balance is not updated automatically<br \/>\n15. Last balance change value<br \/>\n16. Shows if the last balance change was positive or negative<br \/>\n17. Progress toward your set goal<br \/>\n18. Balance expiration date<br \/>\n19. Shows that the balance expiration date was calculated<\/p>", "faq", "en");
t.add("answer.28", "If you invite users and they join AwardWallet you get free 6-month upgrades for every 5 people who join, however, there is more to it. If <a href=\"\/agent\/invites.php\">any of the people you invite<\/a> pay us for AwardWallet Plus, you will get bonus points in proportion to their contribution. If the people you invited don&#39;t pay us for upgrades you don&#39;t get any points. When you reach <a href=\"\/agent\/redeem.php\">certain thresholds<\/a>, we will convert those points into miles of your choice and deposit those miles or points into your loyalty account. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/<\/a>", "faq", "en");
t.add("answer.29", "<a href=\"http:\/\/business.awardwallet.com\/\">AwardWallet Business interface<\/a> is designed for our business clients, while AwardWallet.com is designed for individual members to track personal programs for themselves and for their family members. The business interface is designed to:\n<ol class=\"counter-list\">\n\t<li>Manage reward booking requests for your users (additional setup required to enable this feature).<\/li>\n\t<li>Track corporate loyalty programs such as Alaska Airlines (EasyBiz) or KLM BlueBiz programs.<\/li>\n\t<li>Have many linked users under your profile. While regular Awardwallet.com interface is not designed to support hundreds or thousands of linked accounts business interface is designed just for that. You can link a business account with travelers who use regular AwardWallet interface and they can choose what to share with your business account.&nbsp;For example, travelers may choose to only share their reward account numbers or they may let the business&nbsp;to completely administer and monitor their reward accounts.<\/li>\n\t<li>The business interface lets you track individual users travel plans.<\/li>\n\t<li>The business interface comes with an <a href=\"https:\/\/awardwallet.com\/api\/account\">API that allows you to grab account information programmatically<\/a>.&nbsp;<\/li>\n<\/ol>", "faq", "en");
t.add("answer.30", "This feature is only available to business accounts (<a href=\"https:\/\/business.AwardWallet.com\">https:\/\/business.AwardWallet.com<\/a>). If you have an AwardWallet Business account, you can schedule your accounts to be exported as described in our API documentation:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/api\/account\">https:\/\/awardwallet.com\/api\/account<\/a>", "faq", "en");
t.add("answer.31", "<div class=\"flex\" style=\"-webkit-align-items: flex-start;\n    -ms-align-items: flex-start;\n    align-items: flex-start;\">\n<div class=\"flex__info\">\n<p>AwardWallet OneCard is a credit card sized plastic card with magnetic strip (which enables you to check in for your flights at airport kiosks ). The card will have your personal account numbers and program phone numbers printed on the front and back sides. The card can contain up to 30 different loyalty program accounts listed. We have two types of cards: gold and silver. Those AwardWallet members who have over 1 million miles and points will get a gold card and those who have fewer than 1 million miles and points will get a silver card. The cards will be shipped internationally as well as within United States via regular United States Postal Service.<\/p>\n<br>\n<p>OneCard has a flat cost of $10 with free shipping anywhere in the world. &nbsp;More details can be found <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/30-awardwallet-onecard\/\">here<\/a>.<\/p>\n<br>\n<\/div>\n\n<div class=\"flex__image\"><a href=\"#\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/Image\/OneCardSmall.png\" style=\"margin-left: 20px; width: 283px; height: 182px;\" \/><\/a><\/div>\n<\/div>", "faq", "en");
t.add("answer.32", "No, AwardWallet OneCard does not store any of your passwords so if you lose your card you only lose your account numbers, not the passwords.", "faq", "en");
t.add("answer.33", "No. AwardWallet is completely independent of any of the hotels, airlines or credit cards referenced herein and of any of the loyalty programs tracked or monitored using our services.", "faq", "en");
t.add("answer.34", "Yes! Please read the following press relase on this subject:<br \/>\n<br \/>\n<a href=\"http:\/\/news.aa.com\/press-releases\/press-release-details\/2013\/American-Airlines-and-AwardWallet-Offer-New-Reward-Tracking-Technology-for-AAdvantage-Members\/default.aspx\" target=\"_blank\">http:\/\/news.aa.com\/press-releases\/press-release-details\/2013\/American-Airlines-and-AwardWallet-Offer-New-Reward-Tracking-Technology-for-AAdvantage-Members\/default.aspx<\/a>", "faq", "en");
t.add("answer.35", "A business account can be registered from scratch via:<br \/>\n<br \/>\n<a href=\"https:\/\/business.awardwallet.com\/?Register=1\">https:\/\/business.awardwallet.com\/?Register=1<\/a><br \/>\n<br \/>\nOr if you have a personal account on AwardWallet you can create a business account linked to your personal account so that you would be able to use the same credentials to login to a business account and to your personal account. To do that please follow this link:<br \/>\n<br \/>\n<a href=\"http:\/\/awardwallet.com\/agent\/convertToBusiness.php?Start=1\">http:\/\/awardwallet.com\/agent\/convertToBusiness.php?Start=1<\/a>", "faq", "en");
t.add("answer.36", "The price is $2.50 per month per managed member.", "faq", "en");
t.add("answer.37", "Sort of. First of all with the free version you can click on &quot;Edit&quot; by any program to see its expiration (even if it is hidden in the list view). So it is literally one click away. Second, you can ungroup your programs (in the left navigation bar) and then sort your programs by the expiration, by the program name, or by the balance in either direction (Ascending or Descending). Since we always show the first 3 expirations by reordering your programs you control which expirations are visible.", "faq", "en");
t.add("answer.39", "First of all you have to have admin rights on your computer in order to install this extension, in other words you should be able to install other programs on your compuer. If you have gone through installing the extension but AwardWallet keeps telling you that the extension is not installed you should verify two things:\n<ol class=\"counter-list\">\n\t<li>Make sure that the extension is actually enabled. Here are couple of screenshots that can help you do that:<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-1.png\" style=\"width: 675px; height: 427px;\" \/><br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-2.png\" style=\"width: 741px; height: 450px;\" \/><\/li>\n\t<li>Make sure you fully restarted Internet Explorer <span class=\"bold\">after<\/span> enabeling the extension. In most cases closing all the browser windows, but in some cases a computer reboot is required.&nbsp;<\/li>\n<\/ol>\n<br \/>\nIf these steps do not work you can try uninstalling the extension and installing it again from scratch. Here is how you uninstall the extension:<br \/>\n<br \/>\n<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-3.png\" style=\"width: 780px; height: 526px;\" \/><br \/>\n<br \/>\n<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-4.png\" style=\"width: 780px; height: 480px;\" \/>", "faq", "en");
t.add("answer.40", "<ul>\n\t<li>Click the little arrow next to the &quot;Other Calendars&quot; section and choose &quot;Add by URL&quot;:<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/40-1.png\" style=\"width: 737px; height: 401px;\" \/><\/li>\n\t<li>Copy and paste your personal iCal link that you got by clicking the <a href=\"\/trips\/?calendarImport=1\">Calendar auto-import<\/a> button:<br \/>\n\t<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/40-2.png\" style=\"width: 654px; height: 206px;\" \/><\/li>\n\t<li>If your Google Calendar is not getting updated with new travel plans, please add the following string to the end of the url: &quot;?nocache&quot; without the quotes, per <a href=\"https:\/\/productforums.google.com\/forum\/#!topic\/calendar\/ixQnzHmWDSk%5B1-25-false%5D\">this thread<\/a>.<\/li>\n<\/ul>", "faq", "en");
t.add("answer.41", "<ul>\n\t<li>Click File -&gt; New Calendar Subscription:<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-1.png\" style=\"width: 618px; height: 378px;\" \/><\/li>\n\t<li>Copy and paste your personal iCal link that you got by clicking the&nbsp;<a href=\"\/trips\/?calendarImport=1\">Calendar auto-import<\/a>&nbsp;button:<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-2.png\" style=\"width: 604px; height: 151px;\" \/><\/li>\n\t<li>Configure the settings&nbsp;as you see fit:<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-3.png\" style=\"width: 595px; height: 341px;\" \/><\/li>\n<\/ul>", "faq", "en");
t.add("answer.42", "<ul>\n\t<li>Open Microsoft Outlook and switch to your Calendar:<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-1.png\" style=\"width: 231px; height: 257px;\" \/><\/li>\n\t<li>In the top menu bar click &quot;Open Calendar&quot; -&gt; &quot;From Internet&quot;:<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-2.png\" style=\"width: 438px; height: 214px;\" \/><\/li>\n\t<li>Copy and paste your personal iCal link that you got by clicking the&nbsp;<a href=\"\/trips\/?calendarImport=1\">Calendar auto-import<\/a>&nbsp;button:<br \/>\n\t<br \/>\n\t<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-3.png\" style=\"width: 455px; height: 153px;\" \/><\/li>\n<\/ul>", "faq", "en");
t.add("answer.43", "Here is how this works:\n<ul>\n\t<li>You <a href=\"https:\/\/awardwallet.com\/awardBooking\/add\">submit a new reward booking request<\/a> that goes into our booking queue.<\/li>\n\t<li>Someone from the booking team that works with AwardWallet will reach out and work with you.<\/li>\n\t<li>The cost may vary from&nbsp;$150 to $199 per booked person.<\/li>\n<\/ul>\nIt&#39;s worth mentioning that there are two teams involved: the team that does the actual bookings and AwardWallet&#39;s tech support. The AwardWallet team only provides you with a technical platform &ndash; a way to manage your booking requests and to securely share your reward information with your agent. The booking team will actually do all the groundwork: they search for availability, they run different options by you (so they will communicate with you back and forth before any tickets are booked), they find the most optimal and least expensive routes, they do the actual bookings, and they handle the payments. They are the experts at doing reward bookings, they have done tens of thousands of bookings for their clients and they are very creative in finding availability. All of the communication about a booking request is done via AwardWallet website where you can manage your requests and communicate with your booking agent about your requests. So if you have a question related to a booking request please don&rsquo;t send it to AwardWallet support as we would not be able to help you, instead, you need to login to your account and respond to <a href=\"https:\/\/awardwallet.com\/awardBooking\/requests?archive=1\">your existing booking request<\/a>&nbsp;or create a new booking request:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/awardBooking\/add\">https:\/\/awardwallet.com\/awardBooking\/add<\/a><br \/>\n<br \/>\nFor more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/23-award-booking-service\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/23-award-booking-service\/<\/a>", "faq", "en");
t.add("answer.44", "Yes, you can enable two-factor authentication in your profile making your AwardWallet profile much more secure. At a high level it means you will use your phone to generate a one-time code in addition to your username and password to login to AwardWallet. &nbsp;If you don&rsquo;t know what two-factor authentication is you can read the following <a href=\"https:\/\/en.wikipedia.org\/wiki\/Two-factor_authentication\">Wiki article<\/a> or just <a href=\"https:\/\/www.google.com\/webhp?&amp;q=what+is+two+factor+authentication\">Google it<\/a>.&nbsp;<br \/>\n<br \/>\nSetting up two-factor authentication is very easy; first you need to download a Google Authenticator app, for your <a href=\"https:\/\/play.google.com\/store\/apps\/details?id=com.google.android.apps.authenticator2&amp;hl=en\">Android<\/a>, <a href=\"https:\/\/itunes.apple.com\/us\/app\/google-authenticator\/id388497605?mt=8\">iOS<\/a> or <a href=\"http:\/\/www.windowsphone.com\/en-US\/apps\/021dd79f-0598-e011-986b-78e7d1fa76f8\">Windows Phone<\/a> device. Then you need to click &ldquo;<a href=\"https:\/\/awardwallet.com\/user\/edit.php\">Setup<\/a>&rdquo; under the Two-factor Authentication heading in your <a href=\"https:\/\/awardwallet.com\/user\/edit.php\">AwardWallet profile<\/a>. After that you will see a special QR code that needs to be scanned by the Google Authenticator app to set it up:<br \/>\n&nbsp;\n<div class=\"t-center\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/44.png\" style=\"width: 650px; height: 700px;\" \/><\/div>\n<br \/>\n<br \/>\nThen you enter the code generated by the app into AwardWallet and you are done. Fore more details please check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/<\/a>", "faq", "en");
t.add("answer.45", "In the web interface, once your accounts page is finished loading, just start typing the account name you wish to see, and it will show up. See the following tip for more details:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/<\/a>", "faq", "en");
t.add("answer.46", "If the airline in question is part of an alliance it will have an alliance icon next to it. Click the icon to see all airlines that are part of that alliance. For more details see this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/2-airline-alliance-popup\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/2-airline-alliance-popup\/<\/a>", "faq", "en");
t.add("answer.47", "If you have a large monitor, expanding the width of your browser will automatically add a &quot;Last Updated&quot; column to your account list. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/<\/a>", "faq", "en");
t.add("answer.48", "First, you should update your accounts, then click the + sign next to the program and switch to the &quot;History&quot; tab. All the latest transaction details will show up in there. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/<\/a>", "faq", "en");
t.add("answer.49", "It is different for each account; however, if you click the actual expiration date on any of your accounts you will see an explanation that tells you exactly how we got it. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/5-account-expiration-dates\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/5-account-expiration-dates\/<\/a>", "faq", "en");
t.add("answer.5", "No. AwardWallet cannot sign you up for an award program, nor can we add miles or points to your loyalty accounts. AwardWallet can help you keep track of your award program balances by logging in, on your behalf, to websites that have your balance information. We can not add miles to your program, only the owner of the award program can do that. You would need to contact the airline that you used for travel and request that they add the miles to your account. Then, use AwardWallet to track your balances. AwardWallet is especially useful if you are participating in multiple award programs with different airlines, hotels, credit cards, etc.", "faq", "en");
t.add("answer.50", "Yes, if we detect different active sessions from different locations, we show an alert at the bottom of the Accounts page that you can click to get more details. For more, please see this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/6-multiple-login-alert\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/6-multiple-login-alert\/<\/a>", "faq", "en");
t.add("answer.51", "Yes! You can automatically import your AwardWallet timeline as a separate calendar that will show up alongside your calendar. For that, you simply need to grab your iCal&nbsp;link and add it to your calendar as an additional calendar you wish to view. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/7-automatically-import-travel-plans\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/7-automatically-import-travel-plans\/<\/a>", "faq", "en");
t.add("answer.52", "Yes, simply <a href=\"https:\/\/awardwallet.com\/agents\/add\">add your family members&#39; names to your profile<\/a>, and then you can assign loyalty accounts to individual family members names. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/<\/a>", "faq", "en");
t.add("answer.53", "Yes, you can (and should) backup your passwords&nbsp;if you&nbsp;decided to store them locally. You can do that by selecting the accounts you wish to backup and then choose the &quot;Backup Passwords&quot; option from the &quot;Actions&quot; menu. &nbsp;For more details please check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/<\/a>", "faq", "en");
t.add("answer.54", "Yes! That option is available from the &quot;Views&quot; menu. This feature is only available to the AwardWallet Plus members. For more details please see the following tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/10-download-to-excel\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/10-download-to-excel\/<\/a>", "faq", "en");
t.add("answer.55", "Yes, such reports are available from the &quot;Views&quot; menu. For more details please check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/11-recently-changed-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/11-recently-changed-accounts\/<\/a>", "faq", "en");
t.add("answer.56", "Yes, you can <a href=\"https:\/\/awardwallet.com\/agents\/add-connection\">link your accounts<\/a>, and then choose which accounts you wish to share with each other, and what level of access do you wish to provide. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/<\/a>", "faq", "en");
t.add("answer.57", "Yes, just select the account you wish to set a goal for, and choose &quot;Actions&quot; -&gt; &quot;Set account goals&quot;. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/13-setting-account-goals\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/13-setting-account-goals\/<\/a>", "faq", "en");
t.add("answer.58", "Select all the popular accounts you wish to track separately and choose Actions -&gt; Move to \/ from&nbsp;&quot;Active Accounts&quot; Tab, then choose to move them to the Active Accounts tab. You can do the same thing to remove some accounts from the active accounts tab. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/14-marking-accounts-active\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/14-marking-accounts-active\/<\/a>", "faq", "en");
t.add("answer.59", "Yes, you can automatically select all the accounts that have not been updated in 1 week or 1 month and once they are all selected you can press the Update button to start the update process only for those accounts. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/15-manually-update-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/15-manually-update-accounts\/<\/a>", "faq", "en");
t.add("answer.60", "Yes, each account has its own rules for when it gets updated. If you click the + icon next to any account you will see (a) when was this account updated last time and (b) when (and if) this account is going to be automatically updated again. For more details please see this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/16-next-account-update\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/16-next-account-update\/<\/a>", "faq", "en");
t.add("answer.61", "Unfortunately, we can&#39;t claim that we know of all promotions, however, if we do see a good promotion, we alway add it to the <a href=\"https:\/\/awardwallet.com\/promos\">Promos<\/a> section of our website. Then, they also show up under your account details on the Promotions tab. Be sure to check those places periodically! For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/17-promos\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/17-promos\/<\/a>", "faq", "en");
t.add("answer.62", "In the account list, we show your elite status and the progress to the maximum elite level, however, if you wish to see the breakdown of where you are in terms of actually getting to the next level you can go to your account details by clicking the + icon next to your account and going to the Elite Levels tab. For more details check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/18-elite-status\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/18-elite-status\/<\/a>", "faq", "en");
t.add("answer.63", "Yes, you can enter all of them <a href=\"https:\/\/awardwallet.com\/account\/select-provider#\/coupon\">here<\/a>, and AwardWallet will even remind you before they expire just like we do for any other loyalty account. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/19-travel-vouchers\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/19-travel-vouchers\/<\/a>", "faq", "en");
t.add("answer.64", "Yes, we can. When <a href=\"https:\/\/awardwallet.com\/account\/select-provider\">adding a loyalty account<\/a> just browse through the list of programs that fall into the &quot;Shopping&quot; category. You may be surprised! For more details please see this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/20-supported-programs\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/20-supported-programs\/<\/a>", "faq", "en");
t.add("answer.65", "Almost. You can easily spot any accounts that have changed in value during the last 24 hours. They will have either green (for positive change) or blue (for negative change) bar to the left of the account. The actual change will be shown under the balance itself. So if you review just those accounts you will see everything that changed today regardless of how the accounts&nbsp;were updated. For more details please check out this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/22-recently-updated-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/22-recently-updated-accounts\/<\/a>", "faq", "en");
t.add("answer.66", "Yes, when you delete a trip segment we simply hide it from the timeline, to undo it, click &quot;Show Deleted Segments&quot; and then find it and press &quot;Undelete&quot;. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/24-delete-travel-segment\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/24-delete-travel-segment\/<\/a>", "faq", "en");
t.add("answer.67", "Yes, we made that very easy, just go to the first segment of your trip and click the &quot;Create Travel Plan&quot; link on the right, then drag the end of the trip to adjust when it ends. For more details please see this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/25-group-travel-segments\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/25-group-travel-segments\/<\/a>", "faq", "en");
t.add("answer.68", "First of all, thank you! Second, yes we <a href=\"\/faqs#28\">have an affiliate program<\/a>, and all of our logos and screenshots and banners are always neatly organized on <a href=\"https:\/\/awardwallet.com\/media\/logos\">this page<\/a> which BTW, can always be accessed if you just right-click (option-click) on our logo at the top of any page. For more details please review this tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/<\/a>", "faq", "en");
t.add("answer.69", "If we try to update your account X number of times and keep failing we mark that account as &quot;disabled&quot; automatically. You can change that anytime by selecting any account and then enabling (or disabling) it from the Actions menu. If an account is disabled, it is not being tracked by AwardWallet, so it will always be excluded from automatic updates. For more details please review this tip:<br \/>\n&nbsp;<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/29-account-disabled\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/29-account-disabled\/<\/a>", "faq", "en");
t.add("answer.70", "To delete one of the loyalty accounts from your AwardWallet profile you simply need to first&nbsp;select that account by clicking a checkbox next to it and then you will see a button with a trash bin in the menu, which, when clicked, will delete all accounts that are selected.<br \/>\n<br \/>\n<img alt=\"\" src=\"https:\/\/awardwallet.com\/images\/uploaded\/fck\/faq\/en\/70-1.png\" style=\"width: 650px; height: 383px;\" \/>", "faq", "en");
t.add("answer.71", "First, please double-check that you are entering the correct code. If you are 100% sure the code is correct then it could be a time sync issue. If the time on your laptop is 1:00&nbsp;pm and the time on your phone where you are generating the code is 1:03 pm, that would indicate a problem. In that case, you should <a href=\"https:\/\/www.google.com\/search?q=how+to+sync+clock+on+android\">get your&nbsp;phone clock synced<\/a> and then try again.", "faq", "en");
t.add("answer.72", "Unfortunately, at the moment AwardWallet does not offer phone support, so there is no number you can call to talk to us, but you can submit any questions you have via our <a href=\"https:\/\/awardwallet.com\/contact\">Contact Us<\/a> page, and one of our support representatives will be in touch. We typically answer support requests within 1 business day.", "faq", "en");
t.add("answer.73", "If you added one of the qualified credit card accounts to your AwardWallet profile the Credit Card Spend Analysis looks at the rewards you earn with every purchase and analyzes if you are earning only 1 point when you could be earning 2, 3 or even 5 points per dollar. It&nbsp;looks at each transaction, what you earned, how it is categorized and answers the following questions:<br \/>\n<br \/>\n1. Are you maximizing your earning?<br \/>\n2.&nbsp;Could you earn more, and how?<br \/>\n<br \/>\nThis is a premium feature, it is only available to AwardWallet Plus members.&nbsp; For more details on this feature and for comments please see the following tip:<br \/>\n<br \/>\n<a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/31-credit-card-spend-analysis\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/31-credit-card-spend-analysis\/<\/a><br \/>\n<br \/>\nHere is a quick explainer video recorded by our friends from TripAstute:<br \/>\n<br \/>\n<br \/>\n<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/329113573\" webkitallowfullscreen=\"\" width=\"640\"><\/iframe>", "faq", "en");
t.add("answer.74", "Balance Watch monitors a loyalty account to alert you as soon as your balance changes. Points from American Express, Chase, Citi, Marriott, and Capital One don&#39;t always post instantly when you transfer them to partner loyalty programs.&nbsp;<br \/>\n<br \/>\nWhen you find award availability for a flight or hotel, transfer your points and then use this service to make sure you can confirm your reservation before the availability disappears. Once activated, AwardWallet will check your account frequently and send you a desktop, mobile, and email notification as soon as a change is detected.&nbsp;<br \/>\n<br \/>\nHere is a quick explainer video recorded by our friends from TripAstute:<br \/>\n<br \/>\n<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/329111256\" webkitallowfullscreen=\"\" width=\"640\"><\/iframe>", "faq", "en");
t.add("answer.8", "No. AwardWallet is designed to track your award program balances by logging on, on your behalf, to websites that have your balance information. We are not affiliated with those websites (i.e. hilton.com, jetblue.com, etc.) in any way, so you need to resolve any account related issues directly with the provider of the award program. For example, if you do not know how to login to the&nbsp;hilton.com website to check your Hilton Honors balance you need to go to hilton.com\u200b\u200b\u200b\u200b\u200b\u200b\u200b and resolve this problem directly with them before you will be able to use AwardWallet.", "faq", "en");
t.add("answer.9", "<div class=\"_counter-wrap\"><span class=\"_green-blk\">1<\/span> The number one reason for such error is invalid credentials. Before AwardWallet can retrieve your balance information you need to make sure that you can login to the provider&rsquo;s website and see your balance. Here is how you can verify that you are entering valid credentials:<\/div>\n\n<div class=\"_counter-wrap\"><span class=\"_gray-blk\">a<\/span>\n\n<div>Go to AwardWallet and click the &quot;Edit&quot; link by the program in question.<\/div>\n<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-1.png\" style=\"width: 400px; height: 78px;\" \/><\/div>\n\n<div class=\"_counter-wrap\"><span class=\"_gray-blk\">b<\/span>\n\n<div>Then click on &quot;Reveal password&quot; right underneath your password field.<\/div>\n<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-2.png\" style=\"width: 396px; height: 72px;\" \/><\/div>\n\n<div class=\"_counter-wrap\"><span class=\"_gray-blk\">c<\/span>\n\n<div>At this point you will be prompted for your master AwardWallet password. Type it in and click Reveal. &nbsp;After that you should be seeing both your user name and password in clear text.<\/div>\n<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-3.png\" style=\"width: 400px; height: 238px;\" \/><\/div>\n\n<div class=\"_counter-wrap\"><span class=\"_gray-blk\">d<\/span>\n\n<div>Copy your user name and password and then paste &nbsp;(don&#39;t simply re-type)&nbsp; them&nbsp;into the login input boxes on the provider website in question.<\/div>\n<\/div>\n\n<div class=\"_counter-wrap\"><span class=\"_green-blk\">2<\/span> If the provider&#39;s website is asking you some questions about your profile after you login, until you answer those questions, AwardWallet will not be able to check your balance.<\/div>\n\n<div class=\"_counter-wrap\"><span class=\"_green-blk\">3<\/span> If you chose to save your passwords locally, it is possible that you either deleted cookies or changed computers.<\/div>\n\n<div class=\"_counter-wrap\"><span class=\"_green-blk\">4<\/span> It is also possible that the provider&rsquo;s website has changed and AwardWallet is not aware of it. If none of the above is true, please <a class=\"a14pxBlue blue-link\" href=\"\/contact.php\">send a note<\/a> to us and we will do our best to fix the issue.<\/div>", "faq", "en");
