t.add("pay-subscription-discount.product.description", "AwardWallet Plus gives you the following additional features: %list_on% %item_on%Display expiration date of your rewards%item_off%%item_on%Display additional reward account properties%item_off%%item_on%Parallel account updates (5X faster)%item_off% %list_off%", "mobile", "en");
