t.add("pay-subscription.product.description.long", "%p_on%AwardWallet Plus is a subscription-based service, the subscription length is 1 year and when you subscribe it will be set to auto-renew every year thereafter. The cost of the subscription is $30.00 per year without a an early supporter discount, and $10.00 per year with an early supporter discount. AwardWallet Plus gives you the following additional features:%p_off%%list_on% %item_on%Displaying additional reward account properties%item_off%%item_on%Showing all of your loyalty account expirations where expiration is known%item_off%%item_on%When you update all of your accounts they are updated in parallel, up to 5x faster%item_off%%item_on%More comprehensive monitoring and tracking of your flights%item_off% %list_off%%p_on%AwardWallet Plus subscriptions purchased from the app will be charged to your iTunes account and will automatically renew within 24 hours prior to the end of the current subscription period, unless auto-renewal is disabled beforehand. To manage your subscriptions or to disable auto-renewal, after purchase, go to your iTunes account settings. No refunds will be issued after the annual subscription fee has been charged. Any unused portion of a free trial period will be forfeited once a subscription is purchased.%p_off%%p_on%For more details please feel free to review our %link_1%Terms of Use%link_off% and our %link_2%Privacy Policy%link_off%.%p_off%", "mobile", "en");
