t.add("aboutus-header-text1", "\n<div class=\"main-blk\">\n    %heading%\n    <div class=\"main-blk-content\">\n        <p>AwardWallet provides a free service that helps you manage your reward balances and travel itineraries. We support <span class=\"red\">%programs-count% %loyalty.programs.plural%<\/span> \u2013 air, hotel, car rental, credit card and others. Founded in 2004, AwardWallet quickly became a popular choice for both road warriors and casual travelers. Today, over <span class=\"red\">%members-count% %members.plural%<\/span> rely on AwardWallet to manage over <span class=\"red\">%billion-miles-count% %miles.billion.plural%<\/span> representing <span class=\"red\">$%billions-money-count% %money.billion.plural% in value.<\/span> AwardWallet is not affiliated or related to any of the loyalty programs offered by the airlines, hotels or credit cards identified on this website or tracked and monitored using the AwardWallet service.<\/p>\n        <p>In addition to serving the individual traveler, AwardWallet is used by businesses to manage their corporate reward balances, and partners like Points.com use AwardWallet to power reward management on their sites via our API and white-label services.<\/p>\n        <h3>Why AwardWallet?<\/h3>\n        <ul>\n            <li>There are an estimated 10 trillion unused frequent-flier miles in circulation worth over $165 billion.<\/li>\n            <li>20% or more of all frequent-flier miles don\u2019t ever get redeemed.<\/li>\n            <li>Avoid unanticipated reward expirations and account closures.<\/li>\n            <li>Stay on top of your assets.<\/li>\n        <\/ul>\n    <\/div>\n<\/div>\n", "siteinfo", "en");
t.add("alexi-aboutus-desc", "<p>Alexi is the co-founder and leads the development efforts of AwardWallet, which he launched in 2004. From its inception, Alexi has been AwardWallet\u2019s product visionary. He is focused on continual improvement of AwardWallet to meet the needs of its %members%+ global members and to respond to the evolving rewards program landscape, which is reflected in AwardWallet\u2019s recognized leadership in rewards management.<\/p><p>Prior to the creation of AwardWallet, Alexi worked in global enterprise IT Services organizations including, Aelita Software, Quest Software, and Dell. Over 16 years his responsibilities expanded from web development and support to technical account management and systems consulting. Throughout this time Alexi worked with clients including PepsiCo, Inc., Morgan Stanley, ExxonMobil, Fidelity Investments, United Technology, and Publix.<\/p><p>Alexi attended Utah State University where he played NCAA Division I Men\u2019s College Tennis. He graduated Magna Cum Laude with a B.S. in Information Systems Management from Franklin University. Alexi further received a Master of Information Systems Management from DeVry University. Alexi and his wife have four kids; his hobbies include tennis, kiteboarding, snowboarding, and playing guitar.<\/p>", "siteinfo", "en");
t.add("alexi-aboutus-name", "Alexi Vereschaga", "siteinfo", "en");
t.add("award-travel-evangelist", "Award Travel Evangelist", "siteinfo", "en");
t.add("biographies", "Biographies", "siteinfo", "en");
t.add("co-founder-ceo", "Founder and CEO", "siteinfo", "en");
t.add("editor-in-chief", "Editor-in-Chief", "siteinfo", "en");
t.add("erik-aboutus-desc", "<p>Erik joined the AwardWallet team in 2018. He attended the University of Michigan where he earned a Bachelor of Arts in Economics. During school, he discovered points and miles as a way to fund frequent international trips and a semester abroad in Santiago Chile.<\/p><p>Following school, he began traveling full time and co-founded Abroaders.com, a startup that helps travelers earn and redeem rewards points for maximum value.<\/p><p>Erik first connected with AwardWallet while looking for a tool to manage complex award bookings for clients. With the help of the AwardWallet booking platform, he and his team have redeemed over 49 million points for 2.2 million in airfare savings.<\/p><p>Erik lives in Austin, Texas with his wife Gabriela. When not obsessing about points and miles, his hobbies include cooking, photography, learning languages, exploring national parks, watching Michigan athletics (Go Blue!) and of course, travel.<\/p>", "siteinfo", "en");
t.add("erik-aboutus-name", "Erik Paquet", "siteinfo", "en");
