t.add("page.services", "<h3>Things you can do at AwardWallet.com:<\/h3>\n                <ul>\n                    <li>Track and manage your reward balances, today we support <a href=\"%statusLink%\" target=\"blank\">%programs.plural%<\/a><\/li>\n                    <li>Get notified when your balances change and before your points expire<\/li>\n                    <li>Receive notifications about the cheapest and easiest way to prevent your miles from expiring<\/li>\n                    <li>Share travel itineraries and export them to iGoogle calendar<\/li>\n                    <li>Generate a consolidated itinerary from your separate air, hotel, car and dining reservations<\/li>\n                <\/ul>\n                <h3>You can also access AwardWallet via:<\/h3>\n                <ul>\n                    <li>\n                        <i class=\"icon-iphone\"><\/i> <a target=\"_blank\" href=\"%itunesLink%\" target=\"blank\">iPhone App<\/a> (now optimized for iPad)\n                    <\/li>\n                    <li>\n                        <i class=\"icon-android\"><\/i> <a target=\"_blank\" href=\"%playmarketLink%\" target=\"blank\">Android app<\/a>\n                    <\/li>\n                <\/ul>", "siteinfo", "en");
t.add("page.services.title", "Services", "siteinfo", "en");
t.add("richard-aboutus-desc", "<p>Richard Kerr is the founder of <a target=\"_blank\" href=\"https:\/\/www.facebook.com\/groups\/awardtravel101\">Award Travel 101\u2122<\/a>, AwardWallet\u2019s Facebook community. Richard found his way to points and miles while serving as a naval officer living in Japan, looking for cost-effective ways to visit family back home.<\/p><p>In addition to managing AwardWallet\u2019s community presence, Richard serves as a Senior Points and Miles Contributor for The Points Guy. As one of the world\u2019s foremost experts in the travel rewards and loyalty space Richard has been featured in Forbes, Money Magazine, Kiplinger Personal Finance and presented at #SXSW 2017.<\/p><p>Richard has visited over 45 countries and spends his spare time dissecting loyalty program award charts to maximize the value of points and miles while snacking on gummy bears and sipping bourbon. Donations accepted.<\/p>", "siteinfo", "en");
t.add("richard-aboutus-name", "Richard Kerr", "siteinfo", "en");
t.add("static.aboutUs.heading", "<h2>About Us<\/h2>", "siteinfo", "en");
t.add("description.1", "<p>Your next trip to <strong>{{ Timeline().next.location }}<\/strong> <strong>{{ Timeline().next.timeAhead }}<\/strong> can be found here.<\/p>", "tip", "en");
t.add("description.2", "<ol>\n\t<li><a href=\"https:\/\/awardwallet.com\/mailboxes\/\">Link your mailbox<\/a> and we will import all travel reservations that are in that mailbox automatically<\/li>\n\t<li>Forward your travel reservations to <strong>{{ Login }}@AwardWallet.com<\/strong><\/li>\n\t<li>Import your reservations by retrieving them from your loyalty accounts<\/li>\n\t<li>Import your reservations by using a confirmation number<\/li>\n\t<li>Manually enter your travel reservations<\/li>\n<\/ol>", "tip", "en");
t.add("description.4", "<ol>\n\t<li><a href=\"https:\/\/awardwallet.com\/mailboxes\/\">Link your mailbox<\/a> and we will import all travel reservations that are in that mailbox automatically.<\/li>\n\t<li>Forward your travel reservations to <strong>{{ Login }}@AwardWallet.com<\/strong><\/li>\n\t<li>Import your reservations by retrieving them from your loyalty accounts<\/li>\n\t<li>Import your reservations by using a confirmation number<\/li>\n\t<li>Manually enter your travel reservations<\/li>\n<\/ol>", "tip", "en");
t.add("description.6", "<p>Grouping travel segments into logical travel plans allows you to better visually see when one trip begins and another trip ends, it also allows you to share your entire travel plan with friends and family<\/p>", "tip", "en");
t.add("description.7", "<p>Check out a custom report outlining how well you are optimizing which credit cards you use while shopping!<\/p>", "tip", "en");
